import React from 'react';
import Frame4a from './Frame4a';

const Frame4 = () => {
  return (
    <div
      className="frame-container"
      style={{
        width: '100%',
        maxWidth: '1440px',
        minHeight: '400px',
        background: '#FFFFFF',
        position: 'relative',
      }}
    >
      <div style={{ marginTop: '7vw', marginLeft: '22vw' }}>
        <Frame4a />
      </div>
      {/* Frame 4 content goes here */}
    </div>
  );
};

export default Frame4;
